import Nav from "../Nav";
import Helmet from "react-helmet";

function Portfolio() {
  return (
    <div>
      <Helmet>
        <script src="https://cdn.jsdelivr.net/npm/p5@1.4.1/lib/p5.js"></script>
        <script src="../js/sketch.js"></script>
      </Helmet>

      <Nav />
    </div>
  );
}

export default Portfolio;
